import {React} from 'react'

const NotesItem = (props) => {

    const {noteTitle, noteBody, handleDelete} = props

    return (
        <div>
            <h2>{noteTitle}</h2>
            <p>{noteBody}</p>
            <button onChange={handleDelete}>Delete</button>
            <hr/>
        </div>
    )
}

export default NotesItem
